import React,{ Component } from 'react'
import { View,Text, Button, StyleSheet, ImageBackground,Image} from 'react-native';



export default class Friends1 extends Component{
    render() {

        return (
          <View style={{ flex: 1,
            backgroundColor: 'black',
            justifyContent: "center",
            alignItems: 'center',
            textAlign: 'center',
          }}>
            <ImageBackground
            source={require('./assets/friendss.jpg')}
            style={styles.imagemFundo} > 

      <View style={[styles.caixa, styles.elevation]}>
      <Text style={ styles.text }>Friends</Text>
       </View>
            </ImageBackground>



          </View>

        );
    
}

}
const styles = StyleSheet.create({
    titulo: {
      fontSize: 70,
      marginBottom: 40,
      marginTop: 1,
      color: 'white',
  
    },
    container: {
      flex: 1,
      backgroundColor: 'black',
      justifyContent: "center",
      alignItems: 'center',
      textAlign: 'center',
    },
    imagemFundo:{
        height:'100%',
        width:'100%',
        opacity:'10%',
    },
    // topo:{
   // height:'50%',
    //width:'50%',
    // }
    caixa: {
        backgroundColor: '#B31A17',
        alignItems: 'center',
        justifyContent: 'center',
        height: 300,
        width: 300,
        borderRadius: 20,
        alignSelf:'center'
      },
      elevation: {
        height: 300,
        width: 300,
        shadowColor: '#0c0c0c',
      },
  });
